import React from 'react';

function Log(props) {
    return (
        <div className="log">
            <table className="logContents">
                <tr>
                    <td width="5%">{props.timeStamp}</td>
                    <td width="5%">
                        <button>stack</button>
                    </td>
                    <td width="90%">{props.log}</td>
                </tr>
            </table>
        </div>
    );
}

export default Log;
